import React from 'react';

const TicketsFilter = () => {
  return (
    <div className="tickets-filter">
        <button>САМЫЙ ДЕШЕВЫЙ</button>
        <button>САМЫЙ БЫСТРЫЙ</button>
        <button>ОПТИМАЛЬНЫЙ</button>
    </div>
  )
}

export default TicketsFilter;
